import React from 'react'
import "./style.css"

class Head extends React.Component {
	render() {
		const name="title"
		const lastname="tawan"
		const styles={
			backgroundColor: "#F8F8FF",
		}
		return (
	    	<header className="typehead">
				<div className="border border-bottom-0 rounded">
					<h1 style={styles}>wellcome <br/>{name+" "+lastname} {this.props.SumX}</h1>	
				</div>
	  		</header>
	  	);
	}
}

export default Head;
